import React from 'react'
import './header.css'
import logoDesktop from '../../assets/images/logo-desktop.svg'

export default function Header(props) {
    return (
        <header>
            <img src= {logoDesktop} alt="Logo GIFOS" />
            <button type="button" onClick={props.handleDark}>Modo {props.theme}</button>
        </header>
    )
}
